    <div className="">
      <div className="flex items-center justify-center">
        <h2 className='text-3xl font-semibold'>Today's Pick</h2>
      </div>
    </div>
    <div className="p-7">
      <div className="flex flex-wrap gap-2">
        <Card />
        <Card />
